const gymStyle = theme => ({
    paper: {
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        height: "31vh",
        [theme.breakpoints.up('sm')]: {
            paddingTop: theme.spacing(5)
        }
    },
    autocomplete:{
        width: "85%"
    },
    datepicker: {
        width: "85%",
        height: "3rem",
        marginTop: "2rem",
        fontSize: "1rem",
        textAlign: "center"
    }
});

export default gymStyle;
